const Contact = ({contact, handleChange}) => {
    
    return (
        <div className="contact">
            <div className="contact-element"><img src={contact.avatar} alt="new"/></div>
            <div className="contact-element">| {contact.first_name}</div>
            <div className="contact-element">| {contact.last_name}</div>
            <div className="contact-element">|<input type="checkbox" onClick={(event) => handleChange(contact.id)}/></div>
            
        </div>
    )
}

export default Contact;
